import React, { FC } from 'react';
import { makeStyles } from '@material-ui/core/styles';

import ListItem from '@material-ui/core/ListItem';
import ListItemLink from '@material-ui/core/ListItemLink';
import ListItemText from '@material-ui/core/ListItemText';
import Paper from '@material-ui/core/Paper';
import { FixedSizeList, ListChildComponentProps } from 'react-window';


const useStyles = makeStyles((theme) => ({

}));


function renderPatientRow(props: ListChildComponentProps) {
    const { index, style } = props;

    return (
        <ListItemLink button style={style} key={index} href='/clinic/patients?id=${index + 1}'>
            <ListItemText primary={`Patient ${index + 1}`} />
        </ListItemLink>
    );
}


export const Patients: FC = () => {
    const classes = useStyles();

    return (
        <div>
            <h1>List patients here!</h1>
            <Paper>
                <FixedSizeList height={590} width={340} itemSize={46} itemCount={200}>
                    {renderPatientRow}
                </FixedSizeList>
            </Paper>
        </div>
    );
};
